#!/usr/bin/env python
import re
import sys, os, os.path, json
from pycocotools.coco import COCO
from pycocotools.cocoeval import COCOeval
import numpy as np

CLASSES = ('Pedestrian', 'Cyclist', 'Car', 'Truck', 'Tram', 'Tricycle')


def main():
    input_dir = sys.argv[1]
    output_dir = sys.argv[2]

    submit_dir = os.path.join(output_dir, 'res')
    truth_dir = os.path.join(input_dir, 'ref')

    if not os.path.isdir(submit_dir):
        print(f"Submit directory: '{submit_dir}' doesn't exist")
    elif not os.path.isdir(truth_dir):
        print(f"Truth directory: '{truth_dir}' doesn't exist")
    else:
        if not os.path.exists(output_dir):
            os.makedirs(output_dir)

        # splits = ['train', 'val', 'val', 'val']
        splits = ['test', 'test', 'test', 'test']
        submission_list = os.listdir(submit_dir)
        submission_list = [s for s in submission_list if '.json' in s]
        submission_list = sorted(submission_list, key=lambda x: int(re.findall(r'\d+', x)[-1]))

        if len(submission_list) != 4:
            raise ValueError("Exactly 4 .json files are expected as results")

        results = [[] for _ in range(4)]
        for t, submission in enumerate(submission_list):
            split = splits[t]
            gt_file = os.path.join(truth_dir, f"instance_{split}.json")
            coco_gt = COCO(gt_file)
            cat_ids = coco_gt.getCatIds(catNms=CLASSES)

            task_results = json.load(open(os.path.join(submit_dir, submission), "r"))
            if split == 'test':
                task_results = swap_names_for_ids(gt_file, task_results)

            img_ids = test_img_ids[t]
            # img_ids = [tr['image_id'] for tr in task_results]
            coco_dt = coco_gt.loadRes(task_results)

            iou_type = 'bbox'
            coco_eval = COCOeval(coco_gt, coco_dt, iou_type)
            coco_eval.params.catIds = cat_ids
            coco_eval.params.imgIds = img_ids
            coco_eval.params.iouThrs = [0.5, 0.7]
            # coco_eval.params.maxDets = [100]
            coco_eval.evaluate()
            coco_eval.accumulate()

            precisions = coco_eval.eval['precision']
            ious = [0, 0, 0, 0, 0, 0]  # Index of IOU threshold in coco_eval.params for each class.
            # precision: (iou, recall, cls, area range, max detections)
            # Start from i = 1 because i = 0 is background

            for i in range(1, 7):
                s = precisions[ious[i - 1], :, i - 1, 0, -1]
                # If there were no obj. in this case (should never be true)
                if len(s[s > -1]) == 0:
                    res = -1
                else:
                    # Average over all recall rates (101 levels)
                    res = np.mean(s[s > -1])
                results[t].append(res)

        results = np.array(results)
        masked_results = np.ma.array(results, mask=results == -1)
        task_map = np.mean(masked_results, axis=1)
        class_map = np.mean(masked_results, axis=0)
        final_map = np.mean(task_map)

        scores = {"MAP": final_map}
        for t, tmap in enumerate(task_map):
            scores[f"Task_{t + 1}_MAP"] = tmap

        class_keys = [f"AP_{name}" for name in ['pedestrian', 'cyclist', 'car', 'truck', 'tram', 'tricycle']]
        for key, ap in zip(class_keys, class_map):
            scores[key] = ap

        print(scores)
        with open(os.path.join(output_dir, 'scores.txt'), 'w') as f:
            for key, value in scores.items():
                f.write(f"{key}: {value * 100:.2f}\n")


def swap_names_for_ids(gt_file, dt_file):
    with open(gt_file, 'r') as f:
        img_annot = json.load(f)
    name_id_dict = {img['file_name']: img['id'] for img in img_annot['images']}
    for detection in dt_file:
        detection['image_id'] = int(name_id_dict[detection['image_id']])
    return dt_file

